import { AppBar, Box, Container, Toolbar, Typography } from "@mui/material";
import { Link, useNavigate } from 'react-router-dom';
import '../index.css'; // Asegúrate de importar el archivo CSS para el componente Navbar

export default function Navbar() {
  const navigate = useNavigate();

  return (
    <div className="navbar-container"> {/* Agregar la clase "navbar-container" */}
      <AppBar position="static" color="transparent" elevation={0}>
        <Container maxWidth="lg">
          <Toolbar className="navbar"> {/* Agregar la clase "navbar" */}
            <Typography variant="h6" component={Link} to="/" className="logo">
              Bio-Inka
            </Typography>
            <Box className="nav-links">
              <Link to="/inicio/geo">Georreferenciación</Link>
              <Link to="/inicio/iniciova">Destacados</Link>
              <Link to="/inicio/about">Acerca de nosotros</Link>
              <Link to="/inicio/login">Log-In</Link>
            </Box>
          </Toolbar>
        </Container>
      </AppBar>
    </div>
  );
}
